import React from "react";

//import reactstrap
import { Card, CardBody, Container, Row, Col, CardImg } from "reactstrap";

// core components
import SimpleHeader from "components/Headers/SimpleHeader.js";

function Cordinator() {
  const [staffDetails, setStaffDetails] = React.useState([
    {
      key: 1,
      name: "Prof. Arjun Singh Parihar",
      postion: "Chairman",
    },
    {
      key: 2,
      name: "Prof. Atul Agarwal",
      postion: "Coordinator",
    },
    {
      key: 3,
      name: "Prof. Sonal Yadav",
      postion: "Member",
    },
    {
      key: 4,
      name: "Prof. Nandini Sharma",
      postion: "Member",
    },
    {
      key: 5,
      name: "Mr. Anmol Agarwal",
      postion: "Student Representative",
    },
    {
      key: 6,
      name: "Mr. Chinmay Raiker",
      postion: "Student Representative",
    },
    {
      key: 7,
      name: "Mr. Sanket Patil",
      postion: "Student Representative",
    },
    {
      key: 8,
      name: "Mr. Rohit Anjan",
      postion: "Student Representative",
    },
    {
      key: 9,
      name: "Mr. Tanuj Singh Bhadoria",
      postion: "Student Representative",
    },
    {
      key: 10,
      name: "Mr. Shilpi Sonone",
      postion: "Student Representative",
    },
  ]);

  return (
    <>
      <SimpleHeader name="Cordinator" />
      <Container className="mt--6" fluid>
        <Row className="card-wrapper">
          <Col md="4">
            <Card>
              <CardImg
                alt="..."
                src="https://colorlib.com/polygon/kiaalap/img/profile/1.jpg"
                top
                className="p-4"
              />
              <CardBody className="mt-0">
                <Row>
                  <Col align="center">
                    <h4 className="mt-3 mb-1">Name</h4>
                    <span className="text-md">Prof. Arjun Singh Parihar</span>
                  </Col>
                </Row>
                <Row>
                  <Col align="center">
                    <h4 className="mt-3 mb-1">Position</h4>
                    <span className="text-md">Chairman</span>
                  </Col>
                </Row>
                <Row>
                  <Col align="center">
                    <h4 className="mt-3 mb-1">Department</h4>
                    <span className="text-md">department</span>
                  </Col>
                </Row>
              </CardBody>
            </Card>
          </Col>
        </Row>
      </Container>
    </>
  );
}

export default Cordinator;
